      "content": "// SPDX-License-Identifier: MIT

pragma solidity ^0.8.7;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/utils/cryptography/MerkleProof.sol";
import "hardhat/console.sol";

/**
 * @title ClaimContract
 * @notice Disperse NSFW+ tokens per [NIP-7]
 *    <https://snapshot.org/#/nsfwgov.eth/proposal/0xe89121792cc3c030520a53f65e2dd8cd02b5c530e3d4ef8b6286e59377161a98>
 *    <https://solidity.finance/audits/NSFW/>
 */
contract ClaimContract is Ownable {
    using SafeERC20 for IERC20;

    // address of the NSFW token
    IERC20 private immutable _token;

    // PORNROCKET -> NSFW
    // coefficient based on old and new supply
    // 500T / 500k => 1 Billion
    // 50% to existing holders thus a coefficient of 1 million
    uint256 private REDUCTION_COEFFICIENT = 1_000_000; // 1 million

    // Bonus tokens will be vested over six months from claim date
    uint256 private BONUS_VESTING_DURATION_SECS = 6 * 30 * 24 * 3600;

    // Total tokens that have been claimed
    uint256 public totalClaimed = 0;

    // Total bonus tokens that have been claimed
    uint256 public totalBonusClaimed;

    // The hex root of the claim Merkle Tree
    bytes32 public claimMerkleRoot;

    // *** Events
    event TokenClaimed(address, uint256, uint8, bytes32);
    event BonusClaimed(address, uint256, uint8);

    // *** Structs

    // This struct will store claim proof and claim information
    // for each user after claim has been processed successfully
    struct TokenClaim {
        // claim merkle proof
        bytes32 claim;
        // wallet address of beneficiary
        address account;
        // total amount of tokens to claim
        uint256 amount;
        // migration path index
        uint8 migrationPath;
    }

    struct BonusClaim {
        // total amount of tokens to claim
        uint256 amount;
        // amount of bonus tokens claimed by beneficiary
        uint256 claimedAmount;
        // timestamp when vesting period starts
        uint256 startTime;
        // bonus is claimed
        bool isBonusClaimEnded;
    }

    // mapping from address and migrationPath to TokenClaim
    // this is essentially a claim record for each user's migration paths
    mapping(address => mapping(uint8 => TokenClaim)) private tokenClaimed;

    // mapping from address and migrationPath to boolean that claimed token
    mapping(address => mapping(uint8 => bool)) private claimedAddresses;

    // mapping from address and migrationPath to BonusClaim
    // this is essentially a record to track bonus amounts and status
    mapping(address => mapping(uint8 => BonusClaim)) private bonusClaimed;

    // percentage bonus for each migration path
    mapping(uint8 => uint256) private pathBonusPercentage;

    /**
     * @dev Creates a claim and bonus vesting contract.
     * @param token_ address of the ERC20 token contract
     */
    constructor(address token_) {
        require(token_ != address(0x0));
        _token = IERC20(token_);

        pathBonusPercentage[1] = uint256(25); // Migration bonus 25%
        pathBonusPercentage[2] = uint256(50); // Migration bonus 50%
        pathBonusPercentage[3] = uint256(100); // Migration bonus 100%
    }

    function getClaimableAmount(address _account, uint8 _migrationPath) public view returns (uint256) {
        uint256 amount = bonusClaimed[_account][_migrationPath].amount;
        uint256 claimableAmount;
        uint256 bonusPercentage = pathBonusPercentage[_migrationPath];

        if (block.timestamp >= bonusClaimed[_account][_migrationPath].startTime + BONUS_VESTING_DURATION_SECS) {
            claimableAmount = (amount * bonusPercentage) / 100 - bonusClaimed[_account][_migrationPath].claimedAmount;
        } else {
            claimableAmount =
                ((((amount * pathBonusPercentage[_migrationPath]) / 100) *
                    (block.timestamp - bonusClaimed[_account][_migrationPath].startTime)) /
                    BONUS_VESTING_DURATION_SECS) -
                bonusClaimed[_account][_migrationPath].claimedAmount;
        }
        return claimableAmount;
    }

    /**
     * @notice Claim bonus token
     * @param migrationPath migration path index
     */
    function claimBonus(uint8 migrationPath) public {
        // guards
        require(claimedAddresses[msg.sender][migrationPath], "Bonus: Claim token first");
        require(!bonusClaimed[msg.sender][migrationPath].isBonusClaimEnded, "Bonus: Already claimed");
        require(bonusClaimed[msg.sender][migrationPath].startTime <= block.timestamp, "Bonus: Not started");

        uint256 claimableAmount = this.getClaimableAmount(msg.sender, migrationPath);

        bonusClaimed[msg.sender][migrationPath].claimedAmount += claimableAmount;

        if (block.timestamp >= bonusClaimed[msg.sender][migrationPath].startTime + BONUS_VESTING_DURATION_SECS) {
            bonusClaimed[msg.sender][migrationPath].isBonusClaimEnded = true;
        }

        _transferTokens(msg.sender, claimableAmount);

        totalBonusClaimed += claimableAmount;

        emit BonusClaimed(msg.sender, claimableAmount, migrationPath);
    }

    /**
     * @notice Claim token
     * @param amount Amount of tokens to convert denominated in PORNROCKET
     * @param migrationPath migration path index
     * @param _proof claim merkle proof
     */
    function claim(
        uint256 amount,
        uint8 migrationPath,
        bytes32[] calldata _proof
    ) public {
        // guards
        bytes32 _leaf = keccak256(abi.encodePacked(msg.sender, amount, migrationPath));
        require(MerkleProof.verify(_proof, claimMerkleRoot, _leaf), "Claim: Invalid proof");
        require(!claimedAddresses[msg.sender][migrationPath], "Claim: Already claimed");

        // convert PORNROCKET to NSFW
        uint256 claimAmount = ((amount / 1e9) / REDUCTION_COEFFICIENT) * 1e18;

        // index claim
        tokenClaimed[msg.sender][migrationPath] = TokenClaim(_leaf, msg.sender, claimAmount, migrationPath);

        // flag as claimed
        claimedAddresses[msg.sender][migrationPath] = true;

        // send tokens to user
        _transferTokens(msg.sender, claimAmount);

        // increment amount claimed
        totalClaimed += claimAmount;

        // init bonus
        bonusClaimed[msg.sender][migrationPath] = BonusClaim(claimAmount, 0, block.timestamp, false);

        emit TokenClaimed(msg.sender, claimAmount, migrationPath, _leaf);
    }

    /**
     * @dev Returns claimMerkleRoot
     * @return claimMerkleRoot claimMerkleRoot
     */
    function getClaimMerkleRoot() public view returns (bytes32) {
        return claimMerkleRoot;
    }

    /**
     * @dev Returns claim status
     * @return claimStatus claimStatus
     */
    function getClaimStatus(address account, uint8 migrationPath) public view returns (bool) {
        return claimedAddresses[account][migrationPath];
    }

    /**
     * @dev Returns bonus claim status
     * @return bonusClaimStatus bonusClaimStatus
     */
    function getBonusClaimStatus(address account, uint8 migrationPath) public view returns (bool) {
        if (claimedAddresses[account][migrationPath]) {
            return bonusClaimed[msg.sender][migrationPath].isBonusClaimEnded;
        } else {
            return false;
        }
    }

    /**
     * @dev Returns totalClaimed
     * @return totalClaimed totalClaimed
     */
    function getTotalClaimed() public view returns (uint256) {
        return totalClaimed;
    }

    /**
     * @dev Returns totalBonusClaimed
     * @return totalBonusClaimed totalBonusClaimed
     */
    function getTotalBonusClaimed() public view returns (uint256) {
        return totalBonusClaimed;
    }

    /**
     * @dev Returns balance of contract
     * @return contractBalance contractBalance
     */
    function getContractBalance() public view returns (uint256) {
        return _token.balanceOf(address(this));
    }

    /**
     * @dev Returns bonusClaim detail of account and migrationPath
     * @return bonusClaim detail
     */
    function getBonusInfo(address account, uint8 migrationPath) public view returns (BonusClaim memory) {
        return bonusClaimed[account][migrationPath];
    }

    /**
     * @notice set claimMerkleRoot
     * @param _claimMerkleRoot claimMerkleRoot
     */
    function setClaimMerkleRoot(bytes32 _claimMerkleRoot) external onlyOwner {
        claimMerkleRoot = _claimMerkleRoot;
    }

    /**
     * @notice set pathBonusPercentage list regarding to migrationPath
     * @param pathBonusPercentages list of pathBonusPercentage
     */
    function setPathBonusPercentages(uint256[] memory pathBonusPercentages) external onlyOwner {
        for (uint8 i = 0; i < pathBonusPercentages.length; i++) {
            pathBonusPercentage[i + 1] = pathBonusPercentages[i];
        }
    }

    /**
     * @notice transfer token from contract to address
     * @param receiver receiver
     * @param amount amount of token
     */
    function _transferTokens(address receiver, uint256 amount) private returns (uint256) {
        require(amount > 0, "Amount should not be zero");
        require(_token.balanceOf(address(this)) >= amount, "Insufficient balance");

        _token.transfer(receiver, amount);

        return amount;
    }

    /**
     * @notice withdraw token from contract to owner
     */
    function withdraw() external onlyOwner {
        _transferTokens(owner(), _token.balanceOf(address(this)));
    }
}
